import React from "react";
import { BarChart2, AlertTriangle } from "lucide-react";

function Analytics({ tasks, themeConfig }) {
  const today = new Date().toISOString().split("T")[0];

  const overdueTasks = tasks.filter(
    (task) => !task.completed && task.dueDate < today
  );

  const completedTasksByDate = tasks.reduce((acc, task) => {
    if (task.completed && task.completedDate) {
      acc[task.completedDate] = (acc[task.completedDate] || 0) + 1;
    }
    return acc;
  }, {});

  const completionData = Object.entries(completedTasksByDate)
    .sort(([dateA], [dateB]) => new Date(dateA) - new Date(dateB))
    .slice(-7);

  const dates = completionData.map(([date]) => date);
  const completionCounts = completionData.map(([, count]) => count);
  const maxCompletions = Math.max(...completionCounts, 1);
  const completionHeights = completionCounts.map((count) =>
    Math.round((count / maxCompletions) * 20)
  );

  const completionRate =
    tasks.length > 0
      ? (tasks.filter((task) => task.completed).length / tasks.length) * 100
      : 0;

  return (
    <div className={`rounded-lg shadow ${themeConfig.background}`}>
      <div className={`p-4 border-b ${themeConfig.border}`}>
        <h2 className={`font-semibold ${themeConfig.text}`}>
          Analytics & Insights
        </h2>
      </div>
      <div className="p-8">
        <div
          className={`p-4 rounded-lg text-center ${themeConfig.secondaryBg}`}
        >
          <h3
            className={`text-3xl font-bold mb-2 ${
              completionRate >= 75
                ? "text-green-600"
                : completionRate >= 50
                ? "text-yellow-600"
                : "text-red-600"
            }`}
          >
            {completionRate.toFixed(1)}%
          </h3>
          <p className={`${themeConfig.secondaryText}`}>Task Completion Rate</p>
        </div>

        <div className="mt-8">
          <h3 className={`font-medium mb-4 ${themeConfig.text}`}>
            Overdue Tasks
          </h3>
          <div
            className={`p-4 rounded-lg min-h-[100px] ${themeConfig.secondaryBg} ${themeConfig.border}`}
          >
            {overdueTasks.length > 0 ? (
              <ul className="space-y-2">
                {overdueTasks.map((task) => (
                  <li
                    key={task.id}
                    className={`text-sm ${themeConfig.secondaryText}`}
                  >
                    {task.title} (Due: {task.dueDate}, Priority: {task.priority}
                    {task.subject ? `, Subject: ${task.subject}` : ""})
                  </li>
                ))}
              </ul>
            ) : (
              <p className={`text-sm ${themeConfig.secondaryText}`}>
                No overdue tasks! Add new tasks from the Tasks tab to keep your
                schedule on track.
              </p>
            )}
          </div>
        </div>

        <div className="mt-8">
          <h3 className={`font-medium mb-4 ${themeConfig.text}`}>
            Task Completions (Last 7 Days)
          </h3>
          <div
            className={`p-4 rounded-lg border ${themeConfig.secondaryBg} ${themeConfig.border}`}
          >
            {completionData.length > 0 ? (
              <div className="flex justify-between items-end h-40">
                {completionData.map(([date, count], index) => (
                  <div key={date} className="flex flex-col items-center">
                    <div
                      className={`w-4 h-${completionHeights[index]} rounded-t-sm ${themeConfig.primary}`}
                    ></div>
                    <span
                      className={`text-xs mt-2 ${themeConfig.secondaryText}`}
                    >
                      {new Date(date).toLocaleDateString("en-US", {
                        month: "short",
                        day: "numeric",
                      })}
                    </span>
                    <span className={`text-xs ${themeConfig.secondaryText}`}>
                      {count}
                    </span>
                  </div>
                ))}
              </div>
            ) : (
              <div className="flex items-center justify-center h-16">
                <BarChart2 className={`w-6 h-6 ${themeConfig.secondaryText}`} />
                <span className={`ml-2 ${themeConfig.secondaryText}`}>
                  No completions in the last 7 days.
                </span>
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
}

export default Analytics;
